/*Table structure for table `bbs_position` */

DROP TABLE IF EXISTS `bbs_position`;

CREATE TABLE `bbs_position` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '广告位置ID',
  `parent_id` bigint(20) DEFAULT NULL COMMENT '父位置ID=0时，代表的是顶级广告位置',
  `name` varchar(50) DEFAULT NULL COMMENT '广告位置名称',
  `sort` int(4) DEFAULT NULL COMMENT '排列序号，表示同级类目的展现次序，如数值相等则按名称次序排列。取值范围:大于零的整数',
  `is_parent` tinyint(1) DEFAULT '1' COMMENT '该位置是否为父，1为true，0为false',
  `is_enable` tinyint(1) DEFAULT NULL COMMENT '是否启用 0否 1是',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=98 DEFAULT CHARSET=utf8 COMMENT='广告位置';

